import React from 'react';

const Intro = ()=>{
return (
    <div id="container">
        <div className='navBar'>
        <h2 className='logo'> FASHION</h2>
        <ul className="nav-links">
        <li><a href="/catalog">Catalog</a></li>
        <li><a href="/contact">Contact</a></li>
        <li><a href="/team">Team</a></li>
        </ul>
        </div>
    </div>
)
}


export default Intro;
